import React from 'react';
import { useParams, Link } from 'react-router-dom';

const Form = () => {
  const params = useParams();
  const { country } = params;
  console.log({ params });
  return (
    <div>
      <Link to="/">Choose new country</Link>
      { country }
    </div>
  )
};

export default Form;
